import React from "react";
import {BrowserRouter,Route,Routes}from "react-router-dom"
import{Landingpage,Postviewpage,postform}from "react-router-dom"

function App() {
  return (
    <div class="app">
      <BrowserRouter>
       <Routes>
        <Route path="/" element={<Landingpage/>}></Route>
        <Route paht="/postview" element={<Postviewpage/>}></Route>
        <Route path="/postform" element={<postform/>}></Route>  
       </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
